import React from 'react';
import { NavLink } from 'react-router-dom';
const Navigation = () => {
    return (
        <div>
            <ul>
                <NavLink to="/">
                    <li>Accueil</li>
                </NavLink>
                <NavLink to="/about">
                    <li>A propos</li>
                </NavLink>
                <NavLink to="/calculatrice">
                    <li>Calculatrice</li>
                </NavLink>


                <NavLink to="/incrementation">
                    <li>Incrementation</li>
                </NavLink>
            </ul>
        </div>
    );
};

export default Navigation;
